import React from "react";
import sectionImage from "../Images/Section.png";

const Footer = () => {
  return (
    <div>
      <img src={sectionImage} alt="ihkbjnibjkn" className="absolute" />
      Footer
      <div className="relative">
        <div className>
          <div className="p-36 m-40 text-center bg-white text-3xl font-mono">
            <h1>WORK WITH</h1>
            <h1>GULMOHAR TOWNSHIP</h1>
            <p className="text-center text-sm">
              David is committed to the highest level of expertise, knowledge
              and service. Your real estate inquiries are important to us, so
              please expect a prompt reply.
            </p>
            <button className='border-black border-2 text-sm p-4 m-4'>LET'S GET STARTED</button>
          </div>
          <div className='bg-transparent text-white border-white border-2 font-mono p-36 m-40'>
            NEWSLETTER
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
